import React, { useEffect, useState } from "react";
import { Link, useLocation, useNavigate } from "react-router-dom";
import { useScore } from "../../components/ScoreContext";
import ghost from "../../assets/ghostImg/ghost1.webp"
import { toast } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';
import { gameover } from "../Dead/gameover";

const Page4a = () => {
  const { score, decreaseScore, isDead } = useScore();

  const navigate = useNavigate();
  const location = useLocation();
  
  if(isDead){
    gameover(navigate);
  }
  
  useEffect(() => {
    if (!location.state || !location.state.auth) {
      navigate("/");
    }
  }, []);
  const handleClick = () => {
    navigate("/page4b", {
      state: {
        auth: true,
      },
    });
  };
  const handleClick2 = () => {
    decreaseScore(10);
    if(isDead){
      gameover(navigate);
    }
    toast.error("WRONG GATE! You have returned to where you started.", {
      position: toast.POSITION.BOTTOM_RIGHT
    });
    navigate("/page4a", {
      state: {
        auth: true,
      },
    });
  };

  const [fadeIn, setFadeIn] = useState(false);
  useEffect(() => {
    const timer = setTimeout(() => {
      setFadeIn(true);
    }, 150);
    return () => clearTimeout(timer);
  }, []);

  return (
    <>
      <div className={`fade-in-panel2 ${fadeIn ? "fade-in" : ""}`}>
        <div
          className="imp"
          style={{ position: "absolute", top: "50px", right: "50px" }}
        >
          16.5 x 5.5
        </div>
        <div>
          <img className="ghost-img" width={500} style={{position:"absolute", bottom:"180px", right:"290px", opacity:"0.3"}} src={ghost} alt="" />
        </div>
        <svg
          version="1.2"
          xmlns="http://www.w3.org/2000/svg"
          viewBox="0 0 1024 548"
          width="100vw"
          height="100vh"
        >
          <title></title>
          <defs>
            <image
              width="1024"
              height="576"
              id="img1"
              href="data:image/png;base64,"
            />
            <image
              width="85"
              height="160"
              id="img2"
              href="data:image/png;base64,"
            />
            <image
              width="76"
              height="267"
              id="img3"
              href="data:image/png;base64,"
            />
          </defs>
          <style></style>
          <use id="img1" href="#img1" transform="matrix(1,0,0,1,0,-28)" />
          <use
            id="img2"
            href="#img2"
            style={{ opacity: "1" }}
            onClick={handleClick}
            transform="matrix(1,0,0,1,335,236)"
          />
          <use
            id="img3"
            href="#img3"
            style={{ opacity: "1" }}
            onClick={handleClick2}
            transform="matrix(1,0,0,1,844,220)"
          />
        </svg>
      </div>
    </>
  );
};

export default Page4a;
